sys_ux_client_script.script:
/**
 * @param {params} params
 * @param {api} params.api
 * @param {any} params.event
 * @param {any} params.imports
 */
function handler({api, event, helpers, imports}) {
    var fieldNameNew = '';
    switch(api.state.date_field){
        case "start_date_button":
            fieldNameNew = 'start_new_val';
            break;
        case "ee_prompt_button":
            fieldNameNew = 'ee_prompt_new_val';
            break;
        case "notify_date_button":
            fieldNameNew = 'notify_new_val';
            break;
        case "deadline_button":
            fieldNameNew = 'deadline_new_val';
            break; 
        case "end_date_button":
            fieldNameNew = 'end_new_val';
            break;    
    }
    api.setState(fieldNameNew, api.state.date_picker_new_value);
}
